import React from "react";

class SearchBox extends React.Component {
  render() {
    return (
      <div>
        <style jsx global>{`
      body {
        margin: 0px;
      }
      .container-children {
        height: calc(100% - 110px);
      }
    }
    `}</style>
        <section className="searchBox">
          <form action="">
            <label id="origen">origen</label>
            <input type="text" />
          </form>
        </section>
      </div>
    );
  }
}

export default SearchBox;
